import React from 'react';
import styled, { keyframes } from 'styled-components';

const fadeInUp = keyframes`
  from {
    opacity: 0;
    transform: translateY(30px);
  }
  to {
    opacity: 1;
    transform: translateY(0);
  }
`;

const AboutSection = styled.section`
  padding: 120px 0;
  background-color: ${props => props.theme.colors.background};
  position: relative;
  overflow: hidden;

  &::before {
    content: '';
    position: absolute;
    top: 0;
    left: 0;
    right: 0;
    height: 1px;
    background: linear-gradient(to right, transparent, ${props => props.theme.colors.primary}, transparent);
  }
`;

const Container = styled.div`
  max-width: 1400px;
  margin: 0 auto;
  padding: 0 2rem;
  display: grid;
  grid-template-columns: 1fr 1fr;
  gap: 6rem;
  align-items: center;

  @media (max-width: ${props => props.theme.breakpoints.tablet}) {
    grid-template-columns: 1fr;
    gap: 3rem;
  }
`;

const ImageContainer = styled.div`
  position: relative;

  &::before {
    content: '';
    position: absolute;
    top: -20px;
    left: -20px;
    width: 100%;
    height: 100%;
    border: 2px solid ${props => props.theme.colors.primary};
    z-index: 1;
    transition: all 0.3s ease;
  }

  &:hover::before {
    transform: translate(10px, 10px);
  }
`;

const Image = styled.img`
  width: 100%;
  height: auto;
  position: relative;
  z-index: 2;
  box-shadow: 20px 20px 60px rgba(0, 0, 0, 0.1);
  transition: all 0.3s ease;

  &:hover {
    transform: scale(1.02);
  }
`;

const Content = styled.div`
  animation: ${fadeInUp} 1s ease-out;
`;

const Subtitle = styled.h3`
  color: ${props => props.theme.colors.primary};
  font-family: ${props => props.theme.fonts.secondary};
  font-size: 1.2rem;
  font-weight: 500;
  margin-bottom: 1rem;
  text-transform: uppercase;
  letter-spacing: 3px;
`;

const Title = styled.h2`
  font-family: ${props => props.theme.fonts.primary};
  font-size: 3rem;
  color: ${props => props.theme.colors.text};
  margin-bottom: 2rem;
  line-height: 1.2;
  position: relative;

  &::after {
    content: '';
    position: absolute;
    bottom: -10px;
    left: 0;
    width: 60px;
    height: 3px;
    background-color: ${props => props.theme.colors.primary};
  }
`;

const Description = styled.div`
  margin-bottom: 2rem;

  p {
    font-size: 1.1rem;
    line-height: 1.8;
    color: ${props => props.theme.colors.text};
    margin-bottom: 1.5rem;
    opacity: 0.9;
  }
`;

const Stats = styled.div`
  display: grid;
  grid-template-columns: repeat(3, 1fr);
  gap: 2rem;
  margin-top: 3rem;
`;

const StatItem = styled.div`
  text-align: center;
  padding: 1.5rem;
  background: rgba(212, 175, 55, 0.05);
  border-radius: 10px;
  transition: all 0.3s ease;

  &:hover {
    transform: translateY(-5px);
    background: rgba(212, 175, 55, 0.1);
  }
`;

const StatNumber = styled.h4`
  font-family: ${props => props.theme.fonts.primary};
  font-size: 2.5rem;
  color: ${props => props.theme.colors.primary};
  margin-bottom: 0.5rem;
`;

const StatLabel = styled.p`
  font-size: 1rem;
  color: ${props => props.theme.colors.text};
  font-weight: 500;
`;

const Signature = styled.div`
  font-family: ${props => props.theme.fonts.primary};
  font-size: 2rem;
  color: ${props => props.theme.colors.primary};
  margin-top: 2rem;
  font-style: italic;
`;

const About = () => {
  return (
    <AboutSection id="about">
      <Container>
        <ImageContainer>
          <Image src="/images/designer-portrait.jpg" alt="Fabulous Designer" />
        </ImageContainer>
        <Content>
          <Subtitle>Notre Histoire</Subtitle>
          <Title>L'Art de Créer des Espaces Uniques</Title>
          <Description>
            <p>
              Passionnée par l'art et le design depuis mon plus jeune âge, j'ai consacré ma carrière 
              à transformer des espaces ordinaires en lieux extraordinaires. Avec plus de 10 ans 
              d'expérience dans l'architecture d'intérieur, je crois fermement que chaque espace 
              raconte une histoire unique.
            </p>
            <p>
              Ma philosophie de design repose sur l'harmonie entre l'esthétique et la fonctionnalité. 
              Je m'efforce de créer des intérieurs qui non seulement impressionnent visuellement, 
              mais qui améliorent également la qualité de vie de mes clients.
            </p>
          </Description>
          <Stats>
            <StatItem>
              <StatNumber>150+</StatNumber>
              <StatLabel>Projets Réalisés</StatLabel>
            </StatItem>
            <StatItem>
              <StatNumber>10</StatNumber>
              <StatLabel>Années d'Expérience</StatLabel>
            </StatItem>
            <StatItem>
              <StatNumber>98%</StatNumber>
              <StatLabel>Clients Satisfaits</StatLabel>
            </StatItem>
          </Stats>
          <Signature>Fabulous</Signature>
        </Content>
      </Container>
    </AboutSection>
  );
};

export default About;
